      - !ruby/object:RPG::EventCommand {'i': !!int '1', 'c': !!int '101', 'p': ['', !!int '0', !!int '0', !!int '2']}
      - !ruby/object:RPG::EventCommand {'i': !!int '1', 'c': !!int '401', 'p': ['Regrettably, her long hair covers the tips, but

            even so, she is definitely worth a look.

            \se[Book1]If you gaze out to the horizon from the

