      - !ruby/object:RPG::EventCommand {'i': !!int '1', 'c': !!int '250', 'p': [!ruby/object:RPG::SE {'name': 'Book1', 'pitch': !!int '100', 'volume': !!int '100'}]}
      - !ruby/object:RPG::EventCommand {'i': !!int '1', 'c': !!int '101', 'p': ['', !!int '0', !!int '0', !!int '2']}
      - !ruby/object:RPG::EventCommand {'i': !!int '1', 'c': !!int '401', 'p': ['If you want to see them up close, your only option

